  private _handleMouseOver(event: MouseEvent): void {
    const { target } = event || {};

    if (!(target instanceof SVGPathElement) || !target?.id.startsWith('BR-')) return;

    const acronymMatcher = target.id.replace(/BR-([A-Z]{2})/g, '$1');
    const acronymElement = this.renderRoot.querySelector<SVGTextElement>(`#${acronymMatcher}`);

    acronymElement!.style.fill = 'var(--internal-brazil-acronym-hover-color)';
    target.style.fill = 'var(--internal-brazil-bg-hover-color)';
    target.style.stroke = 'var(--internal-brazil-stroke-hover-color)';
  }
